"use strict";(self.webpackChunkceluveat_team_blog=self.webpackChunkceluveat_team_blog||[]).push([[142],{6964:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"/woowa-final","metadata":{"permalink":"/team-blog/back-blog/woowa-final","source":"@site/@backBlog/woowa-final.mdx","title":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30\uc5d0 \ud569\ub958\ud558\uba70","description":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \ud569\ub958\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc9c0\uae08\uae4c\uc9c0 \uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4\uc5d0 \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba70 \ud55c\ud3b8\uc758 \uae00\ub85c \ub0a8\uaca8\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.","date":"2023-03-04T00:00:00.000Z","formattedDate":"2023\ub144 3\uc6d4 4\uc77c","tags":[{"label":"\ud68c\uace0","permalink":"/team-blog/back-blog/tags/\ud68c\uace0"},{"label":"\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","permalink":"/team-blog/back-blog/tags/\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4"},{"label":"\uae00\uc4f0\uae30","permalink":"/team-blog/back-blog/tags/\uae00\uc4f0\uae30"}],"readingTime":10.295,"hasTruncateMarker":true,"authors":[{"name":"donghun Shin","url":"https://github.com/shin-mallang","email":"huipulci1@naver.com","imageURL":"https://avatars.githubusercontent.com/u/52229930?v=4","key":"shin-mallang"}],"frontMatter":{"date":"2023-03-04T00:00:00.000Z","authors":"shin-mallang","title":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30\uc5d0 \ud569\ub958\ud558\uba70","description":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \ud569\ub958\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc9c0\uae08\uae4c\uc9c0 \uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4\uc5d0 \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba70 \ud55c\ud3b8\uc758 \uae00\ub85c \ub0a8\uaca8\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.","keywords":["\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","\ud68c\uace0","\uae00\uc4f0\uae30"],"tags":["\ud68c\uace0","\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","\uae00\uc4f0\uae30"]}},"content":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \ud569\ub958\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uc9c0\uae08\uae4c\uc9c0 \uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4\uc5d0 \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba70 \ud55c\ud3b8\uc758 \uae00\ub85c \ub0a8\uaca8\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud569\uaca9\\n\\n<img\\n  src=\\"/img/blog/woowa-final/result.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"20px\\" }}\\n/>\\n\\n\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4 5\uae30 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \ud569\ub958\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.<br />\\n1\ucc28 \ud569\uaca9 \uc18c\uc2dd\uc744 \uc811\ud560 \ub54c\ub3c4 \uc0c1\ub2f9\ud788 \uc5bc\ub5a8\ub5a8 \ud588\ub294\ub370 \uc774\uc81c\ub294 \ucd5c\uc885 \ucf54\ub529 \ud14c\uc2a4\ud2b8\ub97c \uac70\uce58\uace0 \ud569\uaca9 \uc774\uba54\uc77c\uc744 \ub9c8\uc8fc\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\uc544\uc9c1\ub3c4 \ucd5c\uc885 \ucf54\ub529 \ud14c\uc2a4\ud2b8 \ub54c\uc758 \uc77c\uc774 \uae30\uc5b5\ub0a9\ub2c8\ub2e4.<br />\\n\uc2dc\uac04\uc774 10\ubd84 \ubc16\uc5d0 \ub0a8\uc9c0 \uc54a\uc558\uc744 \ub54c \ucf54\ub4dc \uc5d0\ub7ec\uac00 \ud574\uacb0\ub418\uc9c0 \uc54a\uc544\uc11c \ud3ec\uae30\ud560\uae4c \ud558\ub2e4\uac00\ub3c4 \ub05d\uae4c\uc9c0 \ubd99\uc7a1\uace0 \ub298\uc5b4\uc84c\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uc5b4\ub5bb\uac8c \uc5bb\uc5b4\ub0b8 \uae30\ud68c\uc778\ub370, \uc774 \uae30\ud68c\uc5d0 \uc81c \ucd5c\uc120\uc744 \ub2e4 \ub2f4\uc544\ubcf4\uace0 \uc2f6\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\ub798\uc57c \ub5a8\uc5b4\uc838\ub3c4 \ud6c4\ud68c\uac00 \ub0a8\uc9c0 \uc54a\uc744 \uac83 \uac19\uc558\ub2ec\uae4c\uc694?\\n\uc9c4\uc2ec\uc774 \ub2ff\uc558\ub358 \uac78\uae4c, 4\ubd84\uc744 \ub0a8\uae30\uace0 \ucf54\ub4dc\uc758 \ubb38\uc81c\uc810\uc744 \ucc3e\uc544\ub0b4\uc11c 10~15\uc904 \uac00\ub7c9 \ub418\ub294 \ucf54\ub4dc\ub97c \uc815\ub9d0 \uc2e0\ub4e4\ub9b0 \ub4ef\uc774 \uc368\ub0b4\ub824\uac14\uc2b5\ub2c8\ub2e4.(\uc9c0\uae08 \uc774\ub807\uac8c \ud558\ub77c\uace0 \ud558\uba74 \uc808\ub300 \ubabb\ud560 \uac83 \uac19\uc544\uc694..:innocent:)\\n\uadf8\ub9ac\uace0 \ub290\ub080\uc810\uc744 \uc791\uc131\ud574 \uc81c\ucd9c\uc744 \ud558\uace0 \uc2dc\uac04\uc744 \ubcf4\ub2c8 1\ubd84 \ucc44 \ub0a8\uc9c0 \uc54a\uc558\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\ud14c\uc2a4\ud2b8\ub3c4 \uc791\uc131\uc744 \ubabb\ud558\uace0 \ucf54\ub4dc\ub3c4 \ub4a4\uc8fd\ubc15\uc8fd \uc11e\uc5ec \uc788\ub294 \uc815\ub9d0 \uad74\ub7ec\ub9cc \uac00\ub294 \uc2a4\ud30c\uac8c\ud2f0 \ucf54\ub4dc\uc600\uc2b5\ub2c8\ub2e4.\\n\ud604\uc7ac \uc2e4\ub825\uc774 \uc774\ub807\uad6c\ub098 \uae68\ub2eb\uae30\ub3c4 \ud588\uc9c0\ub9cc, \uc815\ub9d0 \ucd5c\uc120\uc744 \ub2e4\ud588\uae30\uc5d0 \ud6c4\ud68c\ub294 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub798\uc11c\uc77c\uae4c \uc774\ubc88 \ud569\uaca9\uc740 \uc2a4\uc2a4\ub85c\uc758 \ucd5c\uc120\uacfc \uc9c0\uae08\uae4c\uc9c0 \uc313\uc544\uc628 \ub178\ub825\uc744 \uc218\uace0\ud588\ub2e4\uace0 \uc778\uc815\ud574 \uc8fc\ub294 \uac83 \uac19\uc558\uc2b5\ub2c8\ub2e4.\\n\\n## \ud569\ub958\\n\\n\uc6b0\ud14c\ucf54\ub294 \uc55e\uc73c\ub85c \uc778\uc0dd\uc5d0 \uc788\uc744 \uc218 \uc788\ub294 \uc218\ub9ce\uc740 \uae38 \uc911\uc5d0 \ud558\ub098\ub77c\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4.\\n\uc774 \uae38\uc744 \ud0dd\ud558\uae30 \uc704\ud574 \ucc38 \ub9ce\uc740 \uace0\ubbfc\uc744 \ud588\uc2b5\ub2c8\ub2e4.\\n\ud0dd\ud558\uace0 \ub098\uc11c\ub3c4 \uc815\ub9d0 \ucd5c\uc120\uc744 \ub2e4\ud588\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub807\uac8c \uc57d \ud55c\ub2ec\uc774\ub77c\ub294 \uc2dc\uc791\uc774 \ud758\ub800\uc2b5\ub2c8\ub2e4.<br />\\n\uc774 \ub3d9\uc548 \uc2a4\uc2a4\ub85c\uc640 \uac19\uc774 \ud558\ub294 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uc815\ub9d0 \ub9ce\uc740 \uac10\uc815\uc744 \ub290\uaf08\uc2b5\ub2c8\ub2e4.\\n\uc774 \uac10\uc815\uc744 \uc138\uac1c\uc758 \uba54\uc138\uc9c0\uc5d0 \ub2f4\uc544 \ud45c\ud604\ud574\ubcf4\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4.\\n\\n---\\n\\n#### \ub098\uc640 \ud06c\ub8e8\uc5d0\uac8c\\n\\n### \uad1c\ucc2e\uc544, \uae38\uc744 \uac77\ub294 \uacfc\uc815\uc774\uc796\uc544.\\n\\n\ubd88\uc548\ud558\ub2e4.<br />\\n\uac77\uace0 \uc788\ub294 \uae38\uc774 \uc62c\ubc14\ub978 \uae38\uc778\uc9c0 \uc790\uafb8 \ub4a4\ub3cc\uc544\ubcf4\uac8c \ub41c\ub2e4.\\n\uadf8\ub798\uc11c \uae38\uc744 \uac77\ub2e4\uac00\ub3c4 \uba48\ucdb0\uc11c\uac8c \ub418\uace0 \ubc1c\uac78\uc74c\ub3c4 \uac00\ubccd\uc9c0 \uc54a\ub2e4.\\n\uadf8\ub807\uac8c \uae38 \uac00\uc6b4\ub370\uc11c \uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4\ub77c\ub294 \uc774\uc815\ud45c\ub97c \ubc1c\uacac\ud588\ub2e4.\\n\uc6d0\ub798 \uad00\uc2ec\uc740 \ud06c\uac8c \uc5c6\uc5c8\ub2e4. \uc774 \uae38\uc744 \ub0b4\uac00 \uac08 \uc218 \uc788\ub294 \uae38\uc774\ub77c\uace0 \uc0dd\uac01 \uc870\ucc28 \ud558\uc9c0 \uc54a\uc558\ub2e4.\\n\ud558\uc9c0\ub9cc \uc774\uc815\ud45c\ub97c \ubc14\ub77c\ubcf4\ub2c8 \uc774 \uae38\uc774 \uc5b4\ub5a4\uc9c0 \ud55c \ubc88 \ub290\uaef4 \ubcf4\ub77c\uace0, \uc77c\ub2e8 \uac78\uc5b4\ubcf4\ub77c\uace0 \ud55c\ub2e4.\\n\uc5b4\ub514\uc5d0\uc11c \ub098\uc628 \uc790\uc2e0\uac10\uc77c\uae4c? \uc774 \uae38\uc744 \uac78\uc5b4\ubcf8\ub2e4\uba74 \ucd5c\uc18c\ud55c \ubd88\uc548\uc740 \uc5c6\uc568 \uc218 \uc788\uc744 \uac83\ub9cc \uac19\uc558\ub2e4.\\n\\n> \'\uad1c\ucc2e\uc544, \uae38\uc744 \uac77\ub294 \uacfc\uc815\uc774\uc796\uc544.\'\\n\\n\uc2a4\uc2a4\ub85c \ub2e4\ub3c5\uc600\ub2e4. \uc544\uc9c1 \uacfc\uc815\uc5d0 \ubd88\uacfc\ud558\ub2e4.\\n\uc55e\uc73c\ub85c \ub0a8\uc740 \uae38\uc744 \ud3b8\ud55c \ub9c8\uc74c\uc73c\ub85c \ub098\uc544\uac00\uae30 \uc704\ud574\uc11c\ub294 \ubd88\uc548\uc744 \ud655\uc2e0\uc73c\ub85c \ubc14\uafc0 \ud544\uc694\uac00 \uc788\uc5c8\ub2e4.\\n\uc774\ub807\uac8c \uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4\ub77c\ub294 \uc774\uc815\ud45c\ub97c \ub530\ub77c \uccab \ubc1c\uc790\uad6d\uc744 \ub0b4\ub51b\uc5c8\ub2e4.\\n\\n### \uc798\ud588\uc5b4, \uc774\uc81c\ub294 \ub098\uc544\uac00\ubcf4\uc790.\\n\\n\ud655\uc2e0\ud55c\ub2e4.<br />\\n\uc6d0\ud558\ub358 \uae38\uc774\ub2e4. \uae38 \uc790\uccb4\ub294 \ub108\ubb34\ub098 \ud5d8\ub09c\ud558\uace0 \ud798\ub4e4\ub2e4. \uc2ec\uc9c0\uc5b4 \uc55e\uc73c\ub85c \ub354\uc6b1\ub354 \ud5d8\ub09c\ud574\uc9c8\uac70\ub77c\uace0 \uacbd\uace0\ub3c4 \ud55c\ub2e4.\\n\uadf8\ub7f0\ub370 \ubd88\uc548\ud558\uc9c0 \uc54a\ub2e4. \uae38\uc744 \ub2e4 \ubabb\uac78\uc744\uae4c \uac71\uc815\uc774 \ub420\ub9cc\ub3c4 \ud55c\ub370 \uadf8\ub0e5 \uc774 \uae38\uc744 \uac77\ub294 \uac83 \uc790\uccb4\ub9cc\uc73c\ub85c \uacbd\ucf8c\ud558\ub2e4.\\n\\n\ud559\uad50\ub294 \ub9e4\uc77c\uc774 \uac19\uc558\ub2e4. \uc77c\uc5b4\ub098\uc11c \uc218\uc5c5\uc744 \ub4e3\uace0 \uadf8 \ub0a0 \uc218\uc5c5\uc774 \ubaa8\ub450 \ub05d\ub098\uba74 \uae30\uc219\uc0ac\ub85c \ub3cc\uc544\uac00 \uc26c\uc5c8\ub2e4.\\n\ub531\ud788 \ud798\ub4e4\uc9c0\ub294 \uc54a\uc558\uc9c0\ub9cc, \ub611\uac19\uc740 \uad74\ub808\uc5d0 \uac07\ud78c \ub290\ub08c\uc774\uc5c8\ub2e4.\\n\uc6b0\ud14c\ucf54\ub294 \ub9e4\uc77c\uc774 \ub2e4\ub974\ub2e4. \uc81c\uc77c \ud070 \ucc28\uc774\ub294 \uc0ac\ub78c\ub4e4\uacfc\uc758 \uc18c\ud1b5\uc774\ub2e4. \ub611\uac19\uc774 \uc77c\uc5b4\ub098\uc11c \ucd9c\uadfc\uc744 \ud558\uace0 \uc120\ub989 \ucea0\ud37c\uc2a4\ub85c \ud5a5\ud55c\ub2e4.\\n\ucea0\ud37c\uc2a4\uc5d0 \ub4e4\uc5b4\uc624\ub294 \uc21c\uac04 \ub9c8\uc8fc\uce58\ub294 \ud06c\ub8e8\uc640 \uc778\uc0ac\ub97c \ub098\ub208\ub2e4.\\n\uadf8\ub9ac\uace0 \ub370\uc77c\ub9ac \ubbf8\ud305\uc73c\ub85c \ud558\ub8e8\ub97c \uc2dc\uc791\ud55c\ub2e4. \uc5ec\ub7ec \uc0ac\ub78c\ub4e4\uacfc \uac16\uac00\uc9c0 \ud65c\ub3d9\uc774\ub098 \uc774\uc57c\uae30\ub85c \uc11c\ub85c\uc758 \uac10\uc815\uc744 \uacf5\uc720\ud55c\ub2e4.\\n\ub300\ubd80\ubd84\uc758 \ubbf8\uc158\uacfc \ud68c\uace0\ub294 \ubaa8\ub450 \uc18c\ud1b5\uc744 \uc804\uc81c\ub85c \ud55c\ub2e4. \uc5f0\uadf9\ub3c4 \ud558\uace0 \uae00\uc4f0\uae30\ub3c4 \ud55c\ub2e4. \ud56d\uc0c1 \ub2e4\ub978 \ud398\uc5b4\uc640 \ud558\ub098\uc758 \ucf54\ub4dc\ub97c \uc368 \ub0b4\ub824\uac04\ub2e4.\\n\uc774 \ubaa8\ub4e0 \uacfc\uc815\uc774 \uc990\uac81\ub2e4.\\n\\n\uacfc\uac70\uc5d0\ub294 \ubb34\uc5c7\uc744 \uacf5\ubd80\ud560 \uc9c0 \uace0\ubbfc\ud558\uba70 \uace0\ud1b5\uc2a4\ub7ec\uc6cc\ud588\ub2e4.\\n\uc774\uc81c\ub294 \uc5ec\ub7ec \ubbf8\uc158\ub4e4\uc744 \ud574\uacb0\ud574 \ub098\uac00\uba74\uc11c \uacf5\ubd80\ud558\uace0 \uc2f6\uc740 \uac83\uc774 \uacc4\uc18d \uc0dd\uaca8\ub09c\ub2e4.\\n\ubb3c\ub860 \uc774 \uc591\uc774 \ub108\ubb34 \ub9ce\uc544\uc11c \uae30\uc220 \ubd80\ucc44\ub85c \uc313\uc5ec\uac00\uc9c0\ub9cc \ubd88\uc548\ud558\uc9c0 \uc54a\ub2e4.\\n\uc624\ud788\ub824 \uacf5\ubd80 \ud560 \uc218 \uc788\ub294 \uac83\uc774 \ub9ce\uc544\uc838\uc11c \ub4e4\ub72c\ub2e4.\\n\uc774 \uae38\uc744 \uc120\ud0dd\ud55c \uc790\uc2e0\uc5d0\uac8c \uce6d\ucc2c \ud574\uc8fc\uace0 \uc2f6\ub2e4.\\n\\n> \'\uc798\ud588\uc5b4, \uc774\uc81c\ub294 \ub098\uc544\uac00\ubcf4\uc790.\'\\n\\n\ud655\uc2e0\uc774 \uc0dd\uaca8\uc11c\uc77c\uae4c? \uc81c\ub300\ub85c \ucd94\uc9c4\ub825\uc744 \uc5bb\uc744 \uc218 \uc788\uc5c8\ub2e4. \uc2a4\uc2a4\ub85c \uc774 \uae38\uc744 \uc5f4\uc2ec\ud788 \ub098\uc544\uac00\ubcf4\uc790\uace0 \uc751\uc6d0\ud558\uace0 \uc788\ub2e4.\\n\uadf8\ub807\uac8c \ud604\uc7ac\ub294 \uba48\ucdb0\uc11c\uac70\ub098 \ub4a4\ub97c \uc2e0\uacbd\uc4f0\uc9c0 \uc54a\uace0 \uc55e\uc744 \ubcf4\uba70 \ub098\uc544\uac00\uace0 \uc788\ub2e4.\\n\\n### \uace0\ub9c8\uc6cc, \uac19\uc740 \uae38\uc744 \uac78\uc5b4\uc918\uc11c.\\n\\n\ud589\ubcf5\ud558\ub2e4.<br />\\n\ub09c \uc0ac\ub78c\uc744 \ucc38 \uc88b\uc544\ud55c\ub2e4. \uadf8\ub798\uc11c \uae38\uc744 \ub098\uc544\uac00\uba70 \ub2e4\uc591\ud558\uace0 \uc0c8\ub85c\uc6b4 \uc0ac\ub78c\uc744 \ub9cc\ub0a0 \uc218 \uc788\uc5b4\uc11c \ud589\ubcf5\ud558\ub2e4.\\n\\n> \uc548\ub155\ud558\uc138\uc694~! \ub2c9\ub124\uc784\uc774 \uc5b4\ub5bb\uac8c \ub418\uc138\uc694?\\n\\n\uae38\uc744 \uac77\ub2e4 \uc0c8\ub85c\uc6b4 \uc0ac\ub78c\uc744 \ubcf4\uba74 \ub9d0\uc744 \uac78\uac8c \ub41c\ub2e4. \uadf8 \uc0ac\ub78c\uc5d0 \ub300\ud574 \uc54c\uace0\uc2f6\uace0 \uce5c\ud574\uc9c0\uace0 \uc2f6\uc5c8\ub2e4.\\n\uadf8\ub798\uc11c \uc2dd\uc0ac \uc790\ub9ac\ub97c \ub9cc\ub4e4\uae30\ub3c4 \ud558\uace0 \uc18c\uc18c\ud55c \ub300\ud654 \uc790\ub9ac\ub97c \ub9cc\ub4e4\uc5b4\ubcf4\uae30\ub3c4 \ud588\ub2e4.\\n\uac01\uc790 \ubaa8\ub450 \uac1c\uc131\uc774 \ub118\uce58\uace0 \ucc29\ud574\uc11c \uc6c3\uc74c\uc774 \uc808\ub85c \ub098\uc628\ub2e4. \ud55c \uba85\ub3c4 \ube60\uc9d0\uc5c6\uc774 \ubaa8\ub450\uc640 \uce5c\ud574\uc9c0\uace0 \uc2f6\uc5c8\uace0, \uc815\ub9d0 \uc5f4\uc2ec\ud788 \uc0ac\ub78c\ub4e4\uacfc \uc5b4\uc6b8\ub9ac\ub824\uace0 \ub178\ub825\ud588\ub2e4. <br />\\n\uadf8\ub807\uac8c \uac19\uc774 \uc5b4\uc6b8\ub9ac\uba70 \uac78\uc5b4\uc628 \uc6b0\ud14c\ucf54 \ud06c\ub8e8\ub4e4\uc5d0\uac8c \ub9ce\uc740 \uac83\uc744 \ub290\uaf08\ub2e4. \uc6b0\ud14c\ucf54 \ud06c\ub8e8\ub4e4\uc740 \ucf54\ub529\uc744 \uc5c4\uccad \uc798\ud558\ub294 \uc0ac\ub78c\uc774\ub77c\uace0\ub294 \uc0dd\uac01\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n\ub2e4\ub9cc, \ub2e4\ub4e4 \uc790\uc2e0\uc758 \uc758\uacac\uc744 \ud53c\ub825\ud558\uace0 \ucf54\ub4dc\uc5d0 \uc790\uc2e0\uc758 \uac00\uce58\uad00\uc744 \ub2f4\uc744 \uc904 \uc544\ub294 \uc0ac\ub78c\ub4e4\uc774\ub2e4. \ucf54\ub4dc\ub97c \ubcf4\uba74 \uc774\uac8c \uc5b4\ub5a4 \ud06c\ub8e8\uc758 \ucf54\ub4dc\uc778\uc9c0 \uc870\uae08\uc529 \ubcf4\uc774\uae30 \uc2dc\uc791\ud55c\ub2e4.\\n\uadf8\ub9ac\uace0 \ub2e4\ub4e4 \uc774 \uae38\uc744 \uc790\uc2e0\ub9cc\uc758 \uac1c\uc131\ub300\ub85c \uc990\uac81\uac8c \uac78\uc5b4\uac00\uace0 \uc788\ub2e4. \uc774 \ud48d\uacbd\uc774 \ub108\ubb34 \uba4b\uc788\ub294 \uac83 \uac19\ub2e4. \ub611\uac19\uc740 \uae38\uc744 \uac00\uace0 \uc788\uc9c0\ub9cc \ubaa8\ub450\uac00 \uadf8 \ubc29\ubc95\uc740 \uc870\uae08\uc529 \ub2e4\ub978 \uac83 \uac19\ub2e4.\\n\\n> \'\uace0\ub9c8\uc6cc, \uac19\uc740 \uae38\uc744 \uac78\uc5b4\uc918\uc11c\'\\n\\n\ud568\uaed8 \ub9d0\uc744 \uc11e\uc5b4\ubcf8 \ud06c\ub8e8\ub098 \ucf54\uce58\ubd84\uc774\ub77c\uba74 \uace0\ub9d9\ub2e4\ub294 \ub9d0\uc744 \uc804\ud558\uace0 \uc2f6\ub2e4.\\n\uc774 \ubaa8\ub450\ub294 \uae38\uace0 \ud5d8\ub09c\ud55c \uae38\uc5d0\uc11c \ud798\uacfc \uc790\uadf9\uc744 \uc8fc\uace0 \ud589\ubcf5\uc744 \uc804\ud574\uc900\ub2e4.\\n\uc774 \uc0ac\ub78c\ub4e4\uc774\ub77c\uba74 \ud55c \ub2ec\uc774 \uc544\ub2c8\ub77c \ud55c \ud3c9\uc0dd\uc744 \uac78\uc5b4\ub098\uac00\ub354\ub77c\ub3c4 \uad1c\ucc2e\uc9c0 \uc54a\uc744\uae4c?\\n\\n## \ub9fa\uc74c\ub9d0\\n\\n\uc544\ub9c8 \uc81c\ubaa9\uc744 \ubcf4\uace0 \uc6b0\ud14c\ucf54 5\uae30\uc5d0 \ud569\ub958\ud558\uba74\uc11c \uc5b4\ub5a4 \uc77c\ub4e4\uc774 \uc788\uc5c8\ub294\uc9c0\ub97c \uc0dd\uac01\ud558\uace0 \ub4e4\uc5b4\uc654\uc744 \uc218\ub3c4 \uc788\uc2b5\ub2c8\ub2e4.\\n\ubb3c\ub860 \uc5ec\ub7ec\uac00\uc9c0 \uc0ac\uac74\ub4e4\ub3c4 \uac12\uc9c4 \ucd94\uc5b5\ub4e4\uc785\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \ud55c\ub2ec\uac04 \ub290\ub080 \uc774 \uac10\uc815\ub4e4\uc740 \ub354\uc6b1 \ub354 \uac12\uc9c0\ub2e4\uace0 \ub290\uaf08\uace0 \uc774 \ub290\ub080\uc810\uc744 \uc704\uc8fc\ub85c \uae00\uc744 \uc368\ub0b4\ub824\uac00\uace0 \uc2f6\uc5c8\uc5b4\uc694.\\n\uc800\ub294 \uc55e\uc73c\ub85c 9\uac1c\uc6d4 \ub3d9\uc548 \ub354 \uc774 \uae38\uc744 \uac78\uc5b4\ub098\uac00\uac8c \ub429\ub2c8\ub2e4! \uc774 \ub3d9\uc548 \uc9c0\uae08\uacfc \uac19\uc740 \uac10\uc815\uc774 \uacc4\uc18d\ub418\uae30\ub97c \uae30\ub300\ud558\uace0 \uc788\uc5b4\uc694! \uc5ec\ub7ec\ubd84\ub3c4 \uc751\uc6d0\ud574\uc8fc\uc138\uc694~!"}]}')}}]);